import React from "react";
import "./style.css";

function SoundPhotos(props){
    return(
        <div id="soundphotos"> 
            <p></p>
                <img src="../../public/assets/images/sound/fieldrecording.jpg" alt="Field recording"/>
        </div>
    )
}

export default SoundPhotos;
